(182, 82, 'Update CMS', 'Ferhat Raj guest', 'Admin . Client . ', '{"_method":"PATCH","_token":"rcvSC66RPA6JUfmuzNywyUbGtAXjWN6JWzFo2wlJ","title_en":"PRIVACY  POLICY ","title_ar":"PRIVACY POLICY","alias":"privacy","content_en":"<!--inner area-->\\r\\n<p>Terms and Conditions for Cofe District<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<p>Cofe District is an online platform <a href=\\"http:\\/\\/www.Cofedistrict.com\\">www.Cofedistrict.com<\\/a> and mobile application operated by [enter company name] and is the first coffee application in the State of Kuwait with the aim to connect and facilitate coffee ordering. Cofe District acts as a link between the Partners such as restaurants and coffee shops and the user placing the order.<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<p>For you to place an order on Cofe District mobile application or website, you need to fill out a registration form providing personal information (explained below). Users who fill out and submit the registration form and use Cofe District services are agreeing to the Terms and Conditions.<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<ol>\\r\\n\\t<li><strong>Services Provided <\\/strong><\\/li>\\r\\n<\\/ol>\\r\\n\\r\\n<p>Coffee District provides to its users the following services:<\\/p>\\r\\n\\r\\n<ol>\\r\\n\\t<li>Pick-up Services: You can order for pick-up from the Partners or to request for the Partners to deliver the order to the your vehicle for a drive-thru. Please note that vehicle must be parked in a legal parking zone and must be in a 10 meter radius from the establishment. The fees for such services is at [please enter]<\\/li>\\r\\n\\t<li>On-demand delivery: You will be able to place an order to be delivered in the near future.<\\/li>\\r\\n\\t<li>Schedule Delivery: Allows the user to make pre-orders for the entire week or work week. The fees for such services is at [please enter]<\\/li>\\r\\n<\\/ol>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<p>All Cofe District services aim to link you to Partner, by advertising food and beverages on their behalf. Cofe District does not guarantee the quality of the food or beverages prepared by the Partners, neither does it guarantee that the food and beverages available match the information provided by the establishments on Cofe District.<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<ol>\\r\\n\\t<li><strong>Payment<\\/strong><\\/li>\\r\\n<\\/ol>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<p>Payments available for Cofe Distrct are as follows:<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<ol>\\r\\n\\t<li>Electronic banking services using K-net&rsquo;s payment gateway for pick-up, on-demand delivery or scheduled delivery.<\\/li>\\r\\n\\t<li>Cash payments for on-demand delivery or scheduled delivery.<\\/li>\\r\\n<\\/ol>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<ol>\\r\\n\\t<li><strong>Cancellation Policy <\\/strong><\\/li>\\r\\n<\\/ol>\\r\\n\\r\\n<p>Please read the cancellation policies provided carefully before you make an order.<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<p>For pick-up or on-demand delivery you will have 5 minutes from placing the order to cancel the order. Please note that your bank service provider may charge you a cancellation fee. For scheduled delivery you will have one hour prior to the delivery time to cancel or edit the order.<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<p>For pick-up services please make sure you arrive at the pick-up location at the time of pick-up, if 10 or more minutes pass by then the restaurant will have the right to cancel the order. A cancellation email will be sent out to your email and no refund will be provided. If you are ordering for drive-thru please note that the you need to be parked in a legal zone at time of pick-up, otherwise your order will be moved to the Partners establishment with in 5 minutes and the Partner will have the right to cancel the order and no refund will be provided.<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<p>For on-demand delivery the drivers will wait for 5 minutes at place of delivery, if no one attends to them then Cofe District will have the right to cancel the order and no refund will be provided, the same policy is applicable for scheduled delivery.<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<ol>\\r\\n\\t<li><strong>Refund Policy<\\/strong><\\/li>\\r\\n<\\/ol>\\r\\n\\r\\n<p>Cofe District will provide full and partial refunds to users under the following circumstances:<\\/p>\\r\\n\\r\\n<ol>\\r\\n\\t<li>If the order delivered is different or incorrect from the order placed.<\\/li>\\r\\n\\t<li>If the order is late more than 10 minutes from the delivery or pick-up time.<\\/li>\\r\\n<\\/ol>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<ol>\\r\\n\\t<li><strong>Cofe District Users Obligations <\\/strong><\\/li>\\r\\n<\\/ol>\\r\\n\\r\\n<p>It is the user&rsquo;s obligation to make sure that all Personal Information provided is accurate and correct. The user also needs to confirm the items ordered, as well as the pick-up\\/delivery time, address and all other vital information, as well as service fees.<\\/p>\\r\\n\\r\\n<p>If you have any allergies or special requests please make sure you write them clearly in the space provided when ordering marked Special Request, as Cofe District shall not be held liable for any allergies or health conditions that may arise from consuming such orders. Kindly note that the Partners have the right to refuse any special requests and therefore will cancel the order within 5 minutes with a refund as explained above.<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<p>The Partner will have the right to refuse orders, should the delivery address be out of reach, or should the food or beverage not be available for delivery or should the Partner&rsquo;s operation team be too busy to take such an order. The Partner will therefore have the right to cancel an order before or after acceptance, but will immediately notify and fully refund the user via email.<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<ol>\\r\\n\\t<li><strong>Privacy Policy<\\/strong><\\/li>\\r\\n<\\/ol>\\r\\n\\r\\n<p>All users are requested to provide personal information to Cofe District such as first and last name, email address, phone number, physical addresses needed for delivery as well as GPS location, all referred to collectively as Personal Information. All data is stored in encrypted form. We protect all Personal Information provided to us to help protect your security and confidentiality.<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<p>Other demographic information such as gender, date of birth and other information that does not reveal the users identity may be collected and may be used for<\\/p>\\r\\n\\r\\n<p>In additional Cofe District may collect information regarding previous orders, customer service inquires, reviews, technical information and social networking preferences.<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<p>Cofe District may use cookies, pixel tags, web beacons and other similar technology to facilitate your use of Cofe District mobile application. If you would not like such information to be shares, please make sure you disable cookies.<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<p>Your information may be disclosed if we are under the duty to comply with any legal obligation or court of law requesting to do so. Your demographic information may also be disclosed for marketing or research purposes, the information will be general and will not identify you, protecting your privacy and confidentiality.<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<ol>\\r\\n\\t<li><strong>Amendments<\\/strong><\\/li>\\r\\n<\\/ol>\\r\\n\\r\\n<p>Amendments to the Terms and Conditions may be posted by Cofe District at any time for all users to access and will be binding on the date of publication.<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<ol>\\r\\n\\t<li><strong>Jurisdiction and Governing Law<\\/strong><\\/li>\\r\\n<\\/ol>\\r\\n\\r\\n