ders. Kindly note that the Partners have the right to refuse any special requests and therefore will cancel the order within 5 minutes with a refund as explained above.<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<p>The Partner will have the right to refuse orders, should the delivery address be out of reach, or should the food or beverage not be available for delivery or should the Partner&rsquo;s operation team be too busy to take such an order. The Partner will therefore have the right to cancel an order before or after acceptance, but will immediately notify and fully refund the user via email.<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<ol>\\r\\n\\t<li><strong>Privacy Policy<\\/strong><\\/li>\\r\\n<\\/ol>\\r\\n\\r\\n<p>All users are requested to provide personal information to Cofe District such as first and last name, email address, phone number, physical addresses needed for delivery as well as GPS location, all referred to collectively as Personal Information. All data is stored in encrypted form. We protect all Personal Information provided to us to help protect your security and confidentiality.<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<p>Other demographic information such as gender, date of birth and other information that does not reveal the users identity may be collected and may be used for<\\/p>\\r\\n\\r\\n<p>In additional Cofe District may collect information regarding previous orders, customer service inquires, reviews, technical information and social networking preferences.<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<p>Cofe District may use cookies, pixel tags, web beacons and other similar technology to facilitate your use of Cofe District mobile application. If you would not like such information to be shares, please make sure you disable cookies.<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<p>Your information may be disclosed if we are under the duty to comply with any legal obligation or court of law requesting to do so. Your demographic information may also be disclosed for marketing or research purposes, the information will be general and will not identify you, protecting your privacy and confidentiality.<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<ol>\\r\\n\\t<li><strong>Amendments<\\/strong><\\/li>\\r\\n<\\/ol>\\r\\n\\r\\n<p>Amendments to the Terms and Conditions may be posted by Cofe District at any time for all users to access and will be binding on the date of publication.<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<ol>\\r\\n\\t<li><strong>Jurisdiction and Governing Law<\\/strong><\\/li>\\r\\n<\\/ol>\\r\\n\\r\\n<p>The Terms and Conditions will be legally binding. Any dispute or claim arising will be in accordance to the State of Kuwait.<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<ol>\\r\\n\\t<li><strong>Contact <\\/strong><\\/li>\\r\\n<\\/ol>\\r\\n\\r\\n<p>All questions, comments or concerns, regarding our services or Terms and Conditions can be addressed to <a href=\\"mailto:support@cofedistrict.com\\">support@cofedistrict.com<\\/a>. Please note that all emails may be saved for future references. [please enter address and phone number]<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n<!-- \\/.accordian_example --><!--inner area-->","_route_":"admin\\/cms\\/2"}', '2017-08-24 07:01:15', '2017-08-24 07:01:15'),
(184, 82, 'Update CMS', 'Ferhat Raj guest', 'Admin . Client . ', '{"_method":"PATCH","_token":"MbNcDdYdE3dMH83wEC4rOsLB9aEx40BLq4njQyKU","title_en":"about","title_ar":"about","alias":"about","content_en":"<!--inner area-->\\r\\n<h1>About us<\\/h1>\\r\\n\\r\\n<p>Cofe District platform idea was created to bridge this online - offline gap. The targeted services would enable coffee shops get online quickly and easily so they can maintain direct relationships with their customers.<\\/p>\\r\\n<!--inner area-->","content_ar":"<!--inner area-->\\r\\n<h1>About us<\\/h1>\\r\\n\\r\\n<p>Cofe District platform idea was created to bridge this online - offline gap. The targeted services would enable coffee shops get online quickly and easily so they can maintain direct relationships with their customers.<\\/p>\\r\\n<!--inner area-->","_route_":"admin\\/cms\\/1"}', '2017-08-24 07:22:16', '2017-08-24 07:22:16');
