ies.<\\/p>\\r\\n\\r\\n<p>The User&rsquo;s information will only be disclosed under the duty to comply with any legal obligation or court of law requesting to do so. The User&rsquo;s demographic information may also be disclosed for marketing or research purposes, the information will be general and will not identify the Uder, protecting the User&rsquo;s privacy and confidentiality.&nbsp;<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<p><strong>Amendments<\\/strong><\\/p>\\r\\n\\r\\n<p>Amendments to the Terms and Conditions may be posted by Cofe District at any time for all users to access and will be binding on the date of publication.<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<p><strong>Jurisdiction and Governing Law<\\/strong><\\/p>\\r\\n\\r\\n<p>The Terms and Conditions will be legally binding. Any dispute or claim arising will be in accordance to the State of Kuwait.&nbsp;<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<p><strong>Contact&nbsp;<\\/strong><\\/p>\\r\\n\\r\\n<p>All questions, comments or concerns, regarding our services or Terms and Conditions can be addressed to <a href=\\"mailto:support@cofedistrict.com\\">support@cofedistrict.com<\\/a>. Please note that all emails may be saved for future references.&nbsp;<\\/p>\\r\\n<!-- \\/.accordian_example --><!--inner area-->","content_ar":"<!--inner area-->\\r\\n<h1>Policy &amp; Terms<\\/h1>\\r\\n\\r\\n<h1>&nbsp;<\\/h1>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<p><strong>About us<\\/strong><\\/p>\\r\\n\\r\\n<p>Cofe District is an online platform website&nbsp;and mobile application operated by <strong>District For General Trading Co.<\\/strong> and is the first coffee application in the State of Kuwait with the aim to connect and facilitate coffee ordering by providing a link between Cofe District&rsquo;s Partners such as coffee shops or restaurants and Users that place orders.<\\/p>\\r\\n\\r\\n<p>For Users to place any orders on Cofe District mobile application or website, the user is obliged to fill out a registration form providing personal information (as explained below). Users whom fill out and submit the registration form and use Cofe District services are agreeing to the Terms and Conditions set out below.<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<p><strong>Our Services &nbsp;<\\/strong><\\/p>\\r\\n\\r\\n<p>Cofe District provides to its users the following services:<\\/p>\\r\\n\\r\\n<p><strong>Pick-up Services:<\\/strong> User will be able to order for pick-up through the in-app services. Orders will be placed to Cofe District&rsquo;s Partners providing the User the option for the order to be delivered to the User&rsquo;s parked motor vehicle. All vehichles must be parked in a legal parking zone with close proximity to our Partner&rsquo;s establishment. The Partners will have the right to refuse delivery at their own discretion. The fees for such services is at 0.250 KD.<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<p><strong>On-demand delivery:<\\/strong> The User will also have the option to place to be delivered promptly. The time of delivery will be clearly stated in the order statement.&nbsp;The fees for such services is at 0.500 KD.<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<p><strong>Scheduled Delivery:<\\/strong> Allows the user to make pre-orders for the entire week or on specific days. The fees for such services is at 0.500 KD.<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<p>All Cofe District services aim to link the Users to Partners, by advertising food and beverages on behalf of the Partner&rsquo;s. Cofe District does not guarantee the quality of the food or beverages prepared by the Partners, neither does it guarantee that the food and beverages available match the information provided by the establishments displayed on Cofe District.<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<p><strong>Payment<\\/strong><\\/p>\\r\\n\\r\\n<p>Payment option available for Cofe Distrct is electronic banking services using K-net&rsquo;s payment gateway for pick-up, on-demand delivery or scheduled delivery.<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<p><strong>Cancellation Policy&nbsp;<\\/strong><\\/p>\\r\\n\\r\\n<p>Users agree to the below cancellation terms stated herein by placing an order.<\\/p>\\r\\n\\r\\n<p><strong>Pick-up Services:<\\/strong><\\/p>\\r\\n\\r\\n<ul>\\r\\n\\t<li>Users will have 5 minutes from the time of placing the order to cancel their order<\\/li>\\r\\n\\t<li>Users must make sure to arrive at the pick-up location at the time of pick-up mentioned in the statement order, if the user is not present 10 minutes after the pick-up time, then the Partner will have the right to cancel the order (specifically for orders that may violate health and safety, or the quality of the food or beverage).<\\/li>\\r\\n\\t<li>If the User has requested for the Partner&rsquo;s staff to deliver the order to their vehicle, then the vehicle must be parked in a legal parking zone at time of pick-up, otherwise the order will be moved to the Partners establishment within 5 minutes from time of pick-up and the Partner will have the right to cancel the order and no refund will be provided.<\\/li>\\r\\n<\\/ul>\\r\\n\\r\\n<p><strong>On-demand Delivery:<\\/strong><\\/p>\\r\\n\\r\\n<ul>\\r\\n\\t<li>Users will have 5 minutes from the time of placing the order to cancel the order<\\/li>\\r\\n\\t<li>Drivers will wait for 5 minutes at place of delivery, if the drivers are not attended to within the 5 mins then Cofe District will have the right to cancel the order and no refund will be provided<\\/li>\\r\\n<\\/ul>\\r\\n\\r\\n<p><strong>Scheduled Delivery:<\\/strong><\\/p>\\r\\n\\r\\n<ul>\\r\\n\\t<li>Users need to place orders for scheduled delivery 60 minutes prior to the requested delivery time.<\\/li>\\r\\n<\\/ul>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<p><strong>Refund Policy<\\/strong><\\/p>\\r\\n\\r\\n<p>Cofe District will provide full and partial refunds to users under the following circumstances:<\\/p>\\r\\n\\r\\n<ol>\\r\\n\\t<li>If the order delivered is different or incorrect from the order placed.&nbsp;<\\/li>\\r\\n\\t<li>If the order is late more than 45 minutes from the time of order.<\\/li>\\r\\n<\\/ol>\\r\\n\\r\\n<p>The refund under all circumstances shall be under Cofe District&rsquo;s discretion.&nbsp;<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<p><strong>Cofe District Users Obligations&nbsp;<\\/strong><\\/p>\\r\\n\\r\\n<p>It is the User&rsquo;s obligation to make sure that all Personal Information provided is accurate and correct. The User shall need to confirm before checkout that the items ordered, as well as the pick-up\\/delivery time, address and all other vital information and service fees.<\\/p>\\r\\n\\r\\n<p>User&rsquo;s shall be responsible for clearly stating any allergies, substitutes or any special requests in the space provided marked &ldquo;Special Request&rdquo;, as Cofe District shall not be held liable for any allergies or health conditions that may arise from consuming orders. Partners whom are not able to accommodate the special request or substitute shall inform users 5 minutes within the order time of other options available. If the User&rsquo;s special request can not be accommodated the Partner will have the right to refuse the order and therefore will cancel with a full refund.<\\/p>\\r\\n\\r\\n<p>All orders are subject to availability. The Partner will have the right to refuse orders, should the delivery address be out of reach, or should the food or beverage not be available for delivery or should the Partner&rsquo;s operation team be too busy to take such an order. The Partner will therefore have the right to cancel an order before or after acceptance, but will immediately notify the user via email and fully refund the user.<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<p><strong>Force Majeure&nbsp;<\\/strong><\\/p>\\r\\n\\r\\n<p>Parties to the terms shall not be held responsible for a failure to perform or for improper performance caused by a Force Majeure event.<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<p><strong>Privacy Policy<\\/strong><\\/p>\\r\\n\\r\\n<p>All Users are requested to provide personal information to Cofe District such as first and last name, email address, phone number, physical addresses needed for delivery as well as GPS location, all referred to collectively as Personal Information. All data is stored in encrypted form. We protect all Personal Information provided to us to help protect your security and confidentiality.&nbsp;<\\/p>\\r\\n\\r\\n<p>Other demographic information such as gender, date of birth and other information that does not reveal the User&rsquo;s identity may be collected.&nbsp;In additional Cofe District may collect information regarding previous orders, customer service inquires, reviews, technical information and social networking preferences.&nbsp;<\\/p>\\r\\n\\r\\n<p>Cofe District may use cookies, pixel tags, web beacons and other similar technology to facilitate the use of Cofe District mobile application. If the User would not like such information to be shares, the User shall need to disable cookies.<\\/p>\\r\\n\\r\\n<p>The User&rsquo;s information will only be disclosed under the duty to comply with any legal obligation or court of law requesting to do so. The User&rsquo;s demographic information may also be disclosed for marketing or research purposes, the information will be general and will not identify the Uder, protecting the User&rsquo;s privacy and confidentiality.&nbsp;<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<p><strong>Amendments<\\/strong><\\/p>\\r\\n\\r\\n<p>Amendments to the Terms and Conditions may be posted by Cofe District at any time for all users to access and will be binding on the date of publication.<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<p><strong>Jurisdiction and Governing Law<\\/strong><\\/p>\\r\\n\\r\\n<p>The Terms and Conditions will be legally binding. Any dispute or claim arising will be in accordance to the State of Kuwait.&nbsp;<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<p><strong>Contact&nbsp;<\\/strong><\\/p>\\r\\n\\r\\n<p>All questions, comments or concerns, regarding our services or Terms and Conditions can be addressed to <a href=\\"mailto:support@cofedistrict.com\\">support@cofedistrict.com<\\/a>. Please note that all emails may be saved for future references.&nbsp;<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n<!-- \\/.accordian_example --><!--inner area-->","_route_":"admin\\/cms\\/2"}', '2017-09-16 10:18:29', '2017-09-16 10:18:29'),
