INSERT INTO `faq` (`id`, `title`, `body`, `created_at`, `updated_at`) VALUES
(3, 'Will there be delivery?', '<p>We have several things in store for you. Stay tuned!</p>\r\n', '2017-09-16 11:57:50', '2017-09-16 11:57:50'),
(4, 'When do you start delivering?', '<p>We are working on some cool features to get you your coffee fix. Keep an eye on our account.</p>\r\n', '2017-09-16 11:58:13', '2017-09-16 11:58:13'),
(5, 'Is the pickup feature available all day long?', '<p>Yes. Early birds and night owls can both get a taste from Cofe District.</p>\r\n', '2017-09-16 11:58:43', '2017-09-16 11:58:43'),
(6, 'Is there a minimum charge?', '<p>Nope. We respect all coffees, in all shapes and sizes.</p>\r\n', '2017-09-16 11:59:03', '2017-09-16 11:59:03'),
(7, 'Is there a delivery charge?', '<p>Only a tiny slim 500 fils per delivery.</p>\r\n', '2017-09-16 11:59:17', '2017-09-16 11:59:17'),
(8, 'How long before I go down should I order my coffee for pick up?', '<p>You tell us! 30 minutes, 20 minutes, or even 10 minutes before, and we&rsquo;ll make sure your cup is&nbsp;ready right before you enter the store.</p>\r\n', '2017-09-16 11:59:38', '2017-09-16 11:59:38');
